                        <DataSheet/>
                    </Divrighttest>
                    </Div1>
                    {/* <Divleft>
                        <DataTop/>
                        <DataDraw/>
                    </Divleft>
                    <Divright>
                        <DataSheet/>
                    </Divright> */}
                </Div0>
            </div>
        )}}
export default MainPage2;
